import React from "react";
import "../App.css";
import resume from "./khylecvv23.svg";


function Resume() {
    const style = {
        border: "1px solid #ddd",
        width: "100%",
        height: "500px",
        padding: "10px"
    }


    return (
        <div id="resume" className="RES">
            <img src={resume} style={style} alt={"hell"}></img> 
        </div>
    );
}

export default Resume;
